this.tick = function(game){
  if (game.step % 15 === 0) for (let ship of game.ships) if(!ship.custom.weapons){ ship.emptyWeapons();}
  if (game.step % 30 === 0){
    if(old_gem_pickup = 0){for (let ship of game.ships)if (ship.crystals ===  Math.trunc(ship.type/100) * 5 * Math.trunc(ship.type / 100) * 4) {ship.set({crystals: Math.trunc(ship.type/100) * 5 * Math.trunc(ship.type / 100) * 4 -1})}};
    for (let alien of game.aliens) alien.set({vx:3,shield:alienshield,damage:aliendamage,laser_speed:alienlaserspeed,rate:alienfirespeed});
    for (let ship of game.ships){
      if (game.custom.bans.indexOf(ship.name) != -1){
        ship.gameover({"You have been banned from the game!": " "});
        ship.set({kill:true});
      }
      if (!ship.custom.init){
        ship.custom.init = true;
        sendUI(ship, {
          id: "Options",
          position: [71.5,0,6.6,4],
          clickable: true,
          visible: true,
          shortcut: optionshortcut,
          components: [
            {type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:buttontextcolor,width:5},
            {type: "text",position:[0,30,100,60],value:"Options["+optionshortcut+"]",color:buttontextcolor},
          ]
        });
        ship.custom.option_screen = true;
        sendUI(ship, {
          id: "Restore",
          position: [64.5,0,7.2,4],
          clickable: true,
          visible: true,
          shortcut: "J",
          components: [
            {type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:buttonoutlinecolor,width:5},
            {type: "text",position:[0,30,100,60],value:"Restore["+ restoreshortcut+"]",color:buttontextcolor},
          ]
        });
        sendUI(ship, {
          id: "Stats",
          position: [64.5,4,7.2,4],
          clickable: true,
          visible: true,
          // shortcut: "J",
          components: [
            {type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:buttonoutlinecolor,width:5},
            {type: "text",position:[0,30,100,60],value:"Stats",color:buttontextcolor},
          ]
        });
        sendUI(ship, {
          id: "Gems",
          position: [71.5,4,6.6,4],
          clickable: true,
          visible: true,
          // shortcut: "J",
          components: [
            {type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:buttonoutlinecolor,width:5},
            {type: "text",position:[0,30,100,60],value:"Gems",color:buttontextcolor},
          ]
        });
        welcomeText(ship);
        ship.custom.tree = 0;
        for (let tree = 0; tree < ship_list.length; tree++){
          if (ship_list[tree].indexOf(ship.type) >= 0){
            ship.custom.tree = tree;
            break;
          }
        }
      }
    }
    if (game.aliens.length < max_aliens && alien_portal === true){
      game.addAlien(alien_array[Math.floor(Math.random()*alien_array.length)]);
    }
    if (alien_portal === false){
      for (let alien of game.aliens) alien.set({kill:true});
    }
  }
  if (game.step % 1800 === 0 && game.ships.length > 1 && autolist == true){
    playerData();
  }
  if (game.step % rate*60 === 0 && asteroid_respawn === true){
    restoreMap();
    for (let asteroid of game.asteroids) asteroid.set({size:100,vx:~~(Math.random()*100),vy:~~(Math.random()*100)});
    for (let i=0; i<300; i++) game.addAsteroid({size:100,vx:~~(Math.random()*100),vy:~~(Math.random()*100)});
  }
};

game.modding.tick = function(t){
  this.game.tick(t);
  if (this.context.tick != null){
    this.context.tick(this.game);
  }
};

var sendUI = function(ship, UI){
  if (ship != null && typeof ship.setUIComponent == "function"){
    if (UI.visible || UI.visible == null) ship.setUIComponent(UI);
    else ship.setUIComponent({id: UI.id, position: [0,0,0,0], visible: false});
  }
};

let welcomeText = function (ship, text) {
  clearTimeout(ship.custom.welcomeTextID);
  sendUI(ship, {
    id: "welcome",
    visible: true,
    position: [35,85,30,10],
    components: [
      {type: "text", position: [0,0,100,100], value: text || "Duel and chill, no toxic behaviours please.", color: "#cde"}
    ]
  });
  if (text) ship.custom.welcomeTextID = setTimeout(welcomeText, 2000, ship);
}

var UIevents = {
  switch: function(input,ship){
    let ship_level = Math.trunc(ship.type/100);
    let tree = ship.custom.tree, index = -1;
    index = ship_list[tree].indexOf(ship.type);
    if (index >= 0){
      index = (index + input) % ship_list[tree].length;
      let new_type = ship_list[tree][index];
      shipLevel = Math.trunc(new_type / 100);
      let max_crystals = 20 * shipLevel ** 2;
      ship.set({crystals:((ship_level||0)**2)*20});
      if (ship_level < 7) ship.set({shield:999,stats:88888888,collider:true});
      ship.set({type:new_type,shield:999,collider:true});
    }
  },
  next: function(ship){
    this.switch(1,ship);
    if(ship.type == 704) ship.set({type:101,crystals:20});
  },
  previous: function(ship){
    this.switch(-1,ship);
    if (ship.type == 101) ship.set({type:704,collider:true});
  },
  spectate: function(ship){
    ship.type != 102 ? ship.set({type:102,crystals:0,collider:false}):ship.set({type:103,crystals:0,collider:false});
  },
  reset: function(ship){
    if (ship.type != 101) ship.set({type:101,crystals:20,shield:100,collider:true});
  },
  speedsters: function(ship){
    ship.set({type:speedster_ships[speedster_ships.indexOf(ship.type)+1]||speedster_ships[0],crystals:720,shield:990,collider:true,generator:999});
  },
  restore: function(ship){
    ship.set({shield:999,generator:9999,stats:ship.stats,collider:true});
    this.gems(ship)
  },
  stats: function (ship) {
    ship.set({stats: 999999999*!ship.stats})
  },
  gems: function (ship) {
    ship.set({crystals: ((Math.trunc(ship.type/100)||0)**2)*20})
  },
  admin: function(ship){
  if(ship.custom.authorize === true){
    ship.set({type:admin_ships[admin_ships.indexOf(ship.type)+1]||admin_ships[0],crystals:20,generator:10000,collider:true});
  }},
  yeet: function(ship){
  if(ship.custom.authorize === true){
    ship.set({type:192,crystals:0,vx:0,vy:0,x:985,y:-985});
  }},
  gamer: function(ship){
  if(ship.custom.authorize === true){
    ship.set({x:Math.cos(ship.r)*10+ship.x,y:Math.sin(ship.r)*10+ship.y,z:15});
  }},
  rotate: function(ship){
  if(ship.custom.authorize === true){
    for (let ship of game.ships)
    if (ship.name == aimbotname) ship.set({x:Math.cos(game.ships[aimbotplayer].r)*20+game.ships[aimbotplayer].x,y:Math.sin(game.ships[aimbotplayer].r)*20+game.ships[aimbotplayer].y});
  }},
  empty: function(ship){
    ship.emptyWeapons();
  },
  warp: function (ship) {
    if (game.ships.length <= 1) return;
    let index = ship.custom.index + 1, target = game.ships[index] || game.ships[index = 0];
    if (target == ship) target = game.ships[index + 1] || game.ships[index = 0];
    ship.set({x: target.x, y: target.y});
    ship.custom.index = index;
    this.spectate(ship)
  },
  options: function(ship){
    let abc = Array(ids.length).fill(0).map((r, i) => `${ids.indexOf(ids[i])+1}`);
    let shc = Array.from(Array(5)).map((a,b) => (b+1)*1);
    if (ship.custom.option_screen === true){
      let xpos, ypos = 0;
      for (let i=0; i<ids.length; i++){
        if (i % 5 == 0) ypos++;
        xpos = ypos;
        sendUI(ship, {
          id: ids[i],
          position: [19+i*12-xpos*12*5+12*5,21+ypos*12,12,10],
          clickable: true,
          visible: true,
          shortcut: `${shc[i]||null}`,
          components: [
            {type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            {type: "text",position:[5,35,90,40],value:`${ids[i]}`,color:"#CDE"},
          ]
        });
      }
      ship.custom.option_screen = false;
    } else if (ship.custom.option_screen === false){
      for (let i=0; i<ids.length; i++) sendUI(ship, {id:ids[i],visible:false});
      ship.custom.option_screen = true;
    }
  }
};

this.event = function(event, game){
  var ship = event.ship;
  if (ship != null && !ship.custom.crashed && !ship.custom.timeout) switch (event.name) {
    case "ui_component_clicked":
      if (!ship.custom.lastClickedStep || game.step - ship.custom.lastClickedStep > buttonDelay) {
        var component = event.id;
        switch (component) {
          case "Options":
            UIevents.options(ship);
            break;
          case "Next ship":
            UIevents.next(ship)
            break;
          case "Previous ship":
            UIevents.previous(ship);
            break;
          case "Spectate":
            UIevents.spectate(ship);
            break;
          case "Reset":
            UIevents.reset(ship);
            break;
          case "Speedsters":
            UIevents.speedsters(ship);
            break;
          case "Restore":
            UIevents.restore(ship);
            break;
          case "yeet":
            UIevents.yeet(ship);
            break;
          case "gamer":
            UIevents.gamer(ship);
            break;
          case "rotate":
            UIevents.rotate(ship);
            break;
          case "empty":
            UIevents.empty(ship);
            break;
          case "Admin ship":
            UIevents.admin(ship);
            break;
          case "Warp":
            UIevents.warp(ship);
            break;
          case "Gems":
            UIevents.gems(ship);
            break;
          case "Stats":
            UIevents.stats(ship);
            break;
          default:
            for (let i in boxes) {
              let [x, y] = boxes[i];
              if (component === i) {
                ship.set({x:x,y:y});
                break
              }
            }
            break;
        }
        ship.custom.lastClickedStep = game.step
      }
      else welcomeText(ship, "Too fast, hold up for a bit");
      break;
    case "ship_spawned":
      let x = ship.custom.last_x ?? 0, y = ship.custom.last_y ?? 0;
      ship.set({x:x,y:y,invulnerable:300,crystals:((Math.trunc(ship.type/100)||0)**2)*20});
      break;
    case "ship_destroyed":
      ship.custom.last_x = ship.x;
      ship.custom.last_y = ship.y;
      break;
  }
};
